import Spinner from "react-bootstrap/Spinner";
export const Loading = () => {
  return (
    <div style={{ position: "relative" }}>
      <Spinner
        animation="border"
        role="status"
        variant="danger"
        style={{
          position: "absolute",
          top: "0",
          left: "0",
          right: "0",
          bottom: "0",
          margin: "auto",
        }}
      >
        <span className="visually-hidden">Loading...</span>
      </Spinner>
    </div>
  );
};
